bool solve_sudoku(vector<vector<char> > &board) {
    for (int row = 0; row < 9; ++row) {
      for (int col = 0; col < 9; ++col) {
        if ('.' == board[row][col]) {
          for (int i = 1; i <= 9; ++i) {
            board[row][col] = '0' + i;

            if (is_valid_sudoku(board, row, col)) {
              if (solve_sudoku(board)) {
                return true;
              }
            }

            board[row][col] = '.';
          }

          return false;
        }
      }
    }

    return true;
  }

