void insert_two_nodes(ListNode *node_1,
      ListNode *node_2,
      ListNode *&head,
      ListNode *&tail) {
    if (NULL == head) {
      head = node_2;
      tail = node_2;
    }
    else {
      if (node_2 != NULL) {
        tail->next = node_2;
        tail = node_2;
      }
    }

    if (NULL == head) {
      head = node_1;
      tail = node_1;
    }
    else {
      tail->next = node_1;
      tail = node_1;
    }
  }
